ribed to home phone service, this will be No)'),('telecom_customer_churn','Internet Service','Indicates if the customer subscribes to Internet service with the company: Yes, No'),('internet_types','Internet Type','Indicates the customer\'s type of internet connection: DSL, Fiber Optic, Cable (if the customer is not subscribed to internet service, this will be None)'),('telecom_customer_churn','Avg Monthly GB Download','Indicates the customers average download volume in gigabytes, calculated to the end of the quarter specified above (if the customer is not subscribed to internet service, this will be 0)'),('telecom_customer_churn','Online Security','Indicates if the customer subscribes to an additional online security service provided by the company: Yes, No (if the customer is not subscribed to internet service, this will be No)'),('telecom_customer_churn','Online Backup','Indicates if the customer subscribes to an additional online backup service provided by the company: Yes, No (if the customer is not subscribed to internet service, this will be No)'),('telecom_customer_churn','Device Protection Plan','Indicates if the customer subscribes to an additional device protection plan for their Internet equipment provided by the company: Yes, No (if the customer is not subscribed to internet service, this will be No)'),('telecom_customer_churn','Premium Tech Support','Indicates if the customer subscribes to an additional technical support plan from the company with reduced wait times: Yes, No (if the customer is not subscribed to internet service, this will be No)'),('telecom_customer_churn','Streaming TV','Indicates if the customer uses their Internet service to stream television programing from a third party provider at no additional fee: Yes, No (if the customer is not subscribed to internet service, this will be No)'),('telecom_customer_churn','Streaming Movies','Indicates if the customer uses their Internet service to stream movies from a third party provider at no 