 this customer, calculated to the end of the quarter specified above (Total Charges - Total Refurnds + Total Extra Data Charges + Total Lond Distance Charges)'),('customer_status','Customer Status','Indicates the status of the customer at the end of the quarter: Churned, Stayed, or Joined'),('telecom_customer_churn','Churn Category','A high-level category for the customers reason for churning, which is asked when they leave the company: Attitude, Competitor, Dissatisfaction, Other, Price (directly related to Churn Reason)'),('telecom_customer_churn','Churn Reason','A customers specific reason for leaving the company, which is asked when they leave the company (directly related to Churn Category)'),('Zip Code Population','Zip Code','The zip code of the customers primary residence'),('Zip Code Population','Population','A current population estimate for the entire Zip Code area'),('telecom_customer_churn','status_index','status_index');
